import { Container, ChatIcon, Separator, HeaderIcon } from './styles';

const Nav: React.FC = () => {
  return (
    <Container>
      <HeaderIcon />
      <Separator />
      <ChatIcon />
      <ChatIcon />
      <ChatIcon />
      <ChatIcon />
    </Container>
  );
}

export default Nav;
